          </svg>
          Workflow Builder
        </h2>
        <p className="text-text-secondary">Create and customize your security assessment workflow</p>
      </div>
      <div className="chart-container p-0" style={{ height: 'calc(100vh - 200px)', minHeight: '600px' }}>
        <WorkflowCanvas />
      </div>
    </div>
  );
};

export default Workflow;
